import React from "react";
import { useNavigate } from "react-router-dom";
import { Sparkles, FileText, ShieldCheck } from "lucide-react";

function Dashboard() {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 space-y-6">

      {/* Start Detection */}
      <button
        onClick={() => navigate("/upload")}
        className="px-6 py-3 text-lg font-semibold text-white bg-gradient-to-r from-blue-500 to-purple-600 rounded-xl shadow-lg hover:scale-105 hover:shadow-2xl transition transform"
      >
        <Sparkles className="inline-block mr-2" />
        Start Detection
      </button>

      {/* Upload Document */}
      <button
        onClick={() => navigate("/upload")}
        className="px-6 py-3 text-lg font-semibold text-gray-800 bg-white/30 backdrop-blur-md border border-white/40 rounded-xl hover:bg-white/60 transition"
      >
        <FileText className="inline-block mr-2" />
        Upload Document
      </button>

      {/* Secure Analysis */}
      <button
        onClick={() => alert("Running secure analysis...")}
        className="px-6 py-3 text-lg font-semibold text-white bg-black rounded-xl shadow-[0_0_10px_#00ffcc,0_0_20px_#00ffcc] hover:shadow-[0_0_20px_#00ffcc,0_0_40px_#00ffcc] transition"
      >
        <ShieldCheck className="inline-block mr-2" />
        Secure Analysis
      </button>

    </div>
  );
}

export default Dashboard;
